import styled from 'styled-components'

const LoginStyles = styled.div`
  max-width: ${({ theme }) => theme.maxWidth};
  display: flex;
  justify-content: center;
  div {
    height: 380px;
    width: 350px;
    background-color: white;
    margin-top: 1.2rem;
    border: 1px solid ${({ theme }) => theme.darkGrey };
    border-radius: 2px;
  }
`

const Login = () => (
  <LoginStyles>
    <div>
      <h1>Jackstagram</h1>
    </div>
  </LoginStyles>
)

export default Login
